import styled from "styled-components";
import Link from "next/link";

const FooterWrapper = styled.footer`
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100vw;
  height: 72px;
  border-top: solid 1px #040234;
`;

const Footer = () => {
  return (
    <FooterWrapper>
      <Link>
        <a>Portfolio</a>
      </Link>
      <Link>
        <a>CV</a>
      </Link>
      <a href="mailto:hello@tomwise.me">hello@tomwise.me</a>
    </FooterWrapper>
  );
};

export default Footer;
